		from	SYSCAT.COLUMNS	c
		Where	c.TABSCHEMA = '<%=odiRef.getModel("SCHEMA_NAME")%>'
		) DB2UDB_COLUMNS ON (trim(C.TDOBNM) = DB2UDB_COLUMNS.TABLE_NAME and  trim(C.TDSQLC) = DB2UDB_COLUMNS.COL_NAME )
where trim(C.TDOBNM)  like '<%=odiRef.getModel("REV_OBJ_PATT")%>' 
